import React from "react";

// reactstrap components
import { Container, Row, Col } from "reactstrap";

// core components

function SectionDark() {
  return (
    <>
      <div className="section section-dark">
        <Container>
          <Row>
            <Col className="ml-auto mr-auto text-center" md="8">
              <h2 className="title">TOKEN ADDRESS</h2>
              <h4 className="description">
                TEXTHOLDER129329
              </h4>
              <h4/>
              <p className="description">
              In the hushed hours of the night, a friendly ghost haunts the cozy kitchen, eagerly preparing for a spectral feast. As it delicately places slices of bread into the glowing toaster, the air fills with the comforting scent of toasting bread. This ghostly culinary artist invites you to join in the delight of its favorite midnight snack.

              Come, indulge in the warmth of golden, buttery toast with our cheerful ghost. Each bite is not just food, but a story of comfort and joy shared in the moonlit kitchen. Let the "Ghost with Toast" charm your nights with its simple, heartwarming magic.
              </p>
            </Col>
          </Row>
        </Container>
      </div>
    </>
  );
}

export default SectionDark;
